import axios from 'axios'; // Import axios
import React, { useEffect, useState } from 'react';
import { Bar, BarChart, CartesianGrid, Legend, ResponsiveContainer, Tooltip, XAxis, YAxis } from 'recharts';
import './FarmersDashboard.css';
import indianStates from './data/statesAndDistricts'; // Assuming this contains the states and their districts

const FarmersDashboard = () => {
  // State for selected state, district, and chart data
  const [selectedState, setSelectedState] = useState('');
  const [selectedDistrict, setSelectedDistrict] = useState('');
  const [data, setData] = useState([]); // State for chart data
  const [loading, setLoading] = useState(false); // Loading state
  const [error, setError] = useState(null); // Error state

  // Fetch farmer count data based on selected state and district
  const fetchFarmerCountData = async () => {
    if (!selectedState || !selectedDistrict) return; // Don't fetch if state or district is not selected
    try {
      setLoading(true);
      const response = await axios.get(`http://localhost:8080/growSphere/farmer`, {
        params: {
          state: selectedState,
          district: selectedDistrict,
        },
      });
      setData(response.data); // Set the fetched data to state
      setLoading(false);
    } catch (error) {
      console.error('Error fetching farmer count data:', error);
      setError('Failed to fetch data. Please try again later.');
      setLoading(false);
    }
  };

  // Handle state selection change
  const handleStateChange = (e) => {
    setSelectedState(e.target.value);
    setSelectedDistrict(''); // Reset district when state changes
    setData([]); // Reset data
    setError(null); // Reset error message
  };

  // Handle district selection change
  const handleDistrictChange = (e) => {
    setSelectedDistrict(e.target.value);
  };

  // Find districts based on selected state
  const districts = indianStates.find(state => state.name === selectedState)?.districts || [];

  useEffect(() => {
    fetchFarmerCountData(); // Fetch data when district changes
  }, [selectedDistrict]);

  return (
    <div className="container">
      <h1 className="title">Farmers Under Jurisdiction</h1>
      <div className="filters">
        <select value={selectedState} onChange={handleStateChange} className="state-dropdown">
          <option value="">Select State</option>
          {indianStates.map((state) => (
            <option key={state.name} value={state.name}>
              {state.name}
            </option>
          ))}
        </select>

        <select value={selectedDistrict} onChange={handleDistrictChange} className="district-dropdown" disabled={!selectedState}>
          <option value="">Select District</option>
          {districts.map((district) => (
            <option key={district} value={district}>
              {district}
            </option>
          ))}
        </select>

        <input type="text" placeholder="FPO id" />
        <input type="text" placeholder="Crop id" />
        <input type="text" placeholder="Farmer id" />
        <button className="search-button" onClick={fetchFarmerCountData}>Search</button>
      </div>

      <h2 className="chart-title">Farmer Count</h2>
      <div className="chart-container">
        {loading ? (
          <p>Loading data...</p> // Loading indicator
        ) : error ? (
          <p>{error}</p> // Display error message if fetching fails
        ) : (
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="farmerCount" fill="#8B4513" barSize={40} />
            </BarChart>
          </ResponsiveContainer>
        )}
      </div>
    </div>
  );
};

export default FarmersDashboard;
